import React from "react";
import { ListImage } from "../components/image";
import { changePicture } from "../components/changePicture";

const index = () => {
    return (
        <>
            <div className="text-6xl">Slider </div>
            <div className="flex flex-no-wrap bg-gray-200 overflow-hidden p-10">
                {ListImage.map((src, index) => (
                    <img key={index} className="w-1/2 rounded-lg mx-2" src={src} />
                ))}
            </div>
            <div className="text-center m-5">
                <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded-full mx-5 " onClick={changePicture("L")}> {"<-"} </button>
                <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded-full" onClick={changePicture("R")}> {"->"} </button>
            </div>
        </>
    )
}

export default index;
